import { AlipayCircleOutlined, TaobaoCircleOutlined, WeiboCircleOutlined } from '@ant-design/icons';
import React, {Component, Fragment} from "react"
import {  Form, Input, Icon,  Button, Checkbox, Select, Tabs }  from'antd'

import {withRouter} from "react-router-dom" 
import Scan from "../scan/Scan"
const {Item} = Form
const {TabPane} = Tabs

class Login extends Component{
    constructor(props){
        super(props);
        this.onClick = this.onClick.bind(this)

    }
    onClick(){
        this.props.history.push('/home');

    }
    render(){
        const layout = {
            labelCol: {
              xs: { span: 24, offset: 12},
              sm: { span: 24, offset: 12},
            },
            wrapperCol: {
              xs: { span: 6, offset: 0 },
              sm: { span: 6, offset: 0 },
            },
          };
          const tailLayout = {
            wrapperCol: {
              offset: 5,
              span: 16,
            },
          };
        const { getFieldDecorator } = this.props.form;

        return (
            <Form
            {...layout}
            name="basic"
            style= {{marginTop: 50}}

          >
              <Tabs defaultActiveKey="1" style = {{marginLeft: 300}}>
                  <TabPane tab="Admin" key="1" >
                  <Form.Item label="Name"
              name="name">
                   {getFieldDecorator('address', {
                rules: [{ required: true, message: 'Please input your username!' }],
              })(
              <Input  />
              )} 
                    </Form.Item >


                        <Form.Item label="Password"
              name="password">
                    {getFieldDecorator('password', {
                rules: [{ required: true, message: 'Please input your password!' }],
              })(
              <Input  />
              )} 
                    </Form.Item>
                    <Item {...tailLayout}>
                        <Button type="primary" htmlType="submit" onClick = {this.onClick}>
                            Submit
                        </Button>
                    </Item>

                  </TabPane>
                  <TabPane tab="Unregistered Non-admin" key="2">
                      <Scan/>
                  </TabPane>
                  <TabPane tab="Registered Non-admin" key="3">

                  </TabPane>
              </Tabs>




          </Form>
        )
    }
}
export default Form.create({ name: 'normal_login' }) (withRouter(Login));
